/* eslint-disable react/prop-types */
/* eslint-disable react/react-in-jsx-scope */
import GoogleMapReact from 'google-map-react';

const Map = ({ center, zoom }) => {
    return (
      <div className="map">
        <GoogleMapReact 
          bootstrapURLKeys={{ key: 'AIzaSyDLc15Hjm5QaKqaVugw9RHWnCBjFaVlI0s' }}
          // defaultCenter={center}
          // defaultZoom={zoom}
        />
      </div>

    );
};

Map.defaultProps = {
    center: {
        lat: '0',
        lng: '0',
    },
    zoom: 6,
};

export default Map;
